import { useState } from 'react';
import './App.css';
import Header from './Page/Header';
import Layout from './Page/Layout';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import DreamStay from './Page/DreamStay';
import Wepli from './Page/Wepli';
import GoodSeul from './Page/GoodSeul';

function App() {

  const [activeSection, setActiveSection] = useState('sectionOne');
  return (
    <div>
      <Header activeSection={activeSection} setActiveSection={setActiveSection} />
      <Layout activeSection={activeSection} setActiveSection={setActiveSection} />

      <BrowserRouter>
        <Routes>
          <Route path="/project1" element={DreamStay} />
          <Route path="/project2" element={Wepli} />
          <Route path="/project3" element={GoodSeul} />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
